-- ----------------------------
-- View structure for stuhandsup
-- ----------------------------
DROP VIEW IF EXISTS `stuhandsup`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `stuhandsup` AS SELECT
	Count(0) AS counts,
	rand_num
FROM
	record
WHERE
	type IN ('handsup')
AND record.role = 'stu'
GROUP BY
	rand_num
ORDER BY
	counts DESC ;

-- ----------------------------
-- View structure for teaview
-- ----------------------------
DROP VIEW IF EXISTS `teaview`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `teaview` AS SELECT
Count(0) AS counts,
record.`name`,
record.user_no,
record.rand_num,
record.pad_uuid
FROM
	record
WHERE
	record.type IN (
	'usualAns',
'ques',
	'group',
	'sex',
	'subject',
	'picurl'
)
AND record.role = 'tea'
GROUP BY
record.rand_num
ORDER BY
counts DESC ;
